import React from 'react';
import { useNavigate } from 'react-router-dom';

function ProjectDashboard({ user, projectId, onLogout }) {
  const navigate = useNavigate();

  const handleLogout = () => {
    onLogout();
    navigate('/');
  };

  const handleViewDetails = () => {
    alert(`Viewing details for Project ID: ${projectId}`);
  };

  const handleUpdateInfo = () => {
    alert(`Updating info for Project ID: ${projectId}`);
  };

  return (
    <div className="card">
      <h2>Welcome, {user}!</h2>
      <p>You are viewing <strong>Project ID: {projectId}</strong></p>
      <button className="view-button" onClick={handleViewDetails}>View Project Details</button>
      <button className="view-button" onClick={handleUpdateInfo}>Update Project Info</button>
      <button className="logout-button" onClick={handleLogout}>Logout</button>
    </div>
  );
}

export default ProjectDashboard;
